import { useEffect, useState } from "react";

function UsageCreate() {
  const [items, setItems] = useState([]);
  const [itemName, setItemName] = useState("");   // üîë DOƒûRU STATE
  const [usageType, setUsageType] = useState("USE");
  const [amount, setAmount] = useState("");
  const [date, setDate] = useState("");
  const [message, setMessage] = useState("");

  // üîπ ITEMS LOAD
  useEffect(() => {
    fetch("/api/inventory/items")
      .then(res => res.json())
      .then(data => {
        if (Array.isArray(data)) {
          setItems(data);
        } else {
          console.error("‚ùå Items response is not array:", data);
          setItems([]);
        }
      })
      .catch(err => {
        console.error("‚ùå Failed to load items:", err);
        setItems([]);
      });
  }, []);

  // üîπ AUTO SELECT FIRST ITEM
  useEffect(() => {
    if (items.length > 0 && !itemName) {
      setItemName(items[0].itemName);
    }
  }, [items, itemName]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setMessage("");

    if (!itemName) {
      setMessage("‚ùå Please select an item");
      return;
    }

    const payload = {
      itemName,          // ‚úÖ BACKEND EXPECTS THIS
      usageType,
      amount: Number(amount)
    };

    if (date) payload.date = date;

    try {
      const res = await fetch("/api/inventory/usage", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(payload)
      });

      const data = await res.json();

      if (res.ok) {
        setMessage("‚úÖ Usage recorded successfully");
        setAmount("");
        setDate("");
      } else {
        setMessage("‚ùå " + (data.error || "Failed to record usage"));
      }
    } catch (err) {
      console.error("‚ùå Network error:", err);
      setMessage("‚ùå Network error");
    }
  };

  return (
    <div style={{ maxWidth: 520 }}>
      <h2>Record Usage</h2>

      <form onSubmit={handleSubmit}>
        {/* ITEM */}
        <label>Item</label>
        <br />
        <select
          value={itemName}
          onChange={e => setItemName(e.target.value)}
          required
        >
          <option value="" disabled>
            Please select an item
          </option>

          {items.map(item => (
            <option key={item.itemName} value={item.itemName}>
              {item.itemName}
            </option>
          ))}
        </select>

        <br /><br />

        {/* USAGE TYPE */}
        <label>Usage Type</label>
        <br />
        <select
          value={usageType}
          onChange={e => setUsageType(e.target.value)}
        >
          <option value="USE">USE</option>
          <option value="WASTE">WASTE</option>
          <option value="RECEIVE">RECEIVE</option>
        </select>

        <br /><br />

        {/* AMOUNT */}
        <label>Amount</label>
        <br />
        <input
          type="number"
          step="0.01"
          value={amount}
          onChange={e => setAmount(e.target.value)}
          required
        />

        <br /><br />

        {/* DATE */}
        <label>Date (optional)</label>
        <br />
        <input
          type="date"
          value={date}
          onChange={e => setDate(e.target.value)}
        />

        <br /><br />

        <button type="submit">Save</button>
      </form>

      {message && (
        <p style={{ marginTop: 15 }}>
          {message}
        </p>
      )}
    </div>
  );
}

export default UsageCreate;
